body {
  background: #F8F8F8;
}

/* Clearfix solution */

.container:after {
  content:"";
  display:table;
  clear:both;
}

.header {

}

.animate,
.animate * {
	-webkit-transition: all 0.3s ease-in-out;
	-moz-transition: all 0.3s ease-in-out;
	-o-transition: all 0.3s ease-in-out;
	-ms-transition: all 0.3s ease-in-out;
}

/* Draggable elements */

/* Prevent the text contents of draggable elements from being selectable. */
[draggable] {
  -moz-user-select: none;
  -khtml-user-select: none;
  -webkit-user-select: none;
  user-select: none;
  /* Required to make elements draggable in old WebKit */
  -khtml-user-drag: element;
  -webkit-user-drag: element;
}

/* Dashboard */

.document-cell {
  position: relative;
  padding: 20px;
  background: white;
  margin-bottom: 1px;
  cursor: pointer;
}

.document-cell:hover {
	background: #F8F8F8;
}

.document-cell .subject {
  color: #999;
  font-size: 12px;
  font-weight: 600;
  text-transform: uppercase;
}

.document-cell .title {
  font-size: 20px;
  line-height: 35px;
  padding: 10px 0px;
  margin-right: 100px;
}


.document-cell .authors {
  float: left;
  margin-right: 20px;
  font-size: 15px;
	font-style: italic;
	line-height: 15px;
}

.document-cell .updated-at {
  float: right;
  font-style: italic;
  font-size: 14px;
  color: #999;
}

.document-cell .delete-document {
  display: block;
  position: absolute;
  right: 20px;
  top: 20px;
  color: #D50A46;
}

.dashboard th.sortable a {
	float: right;
	font-size: 15px;
	font-style: italic;
	padding-right: 13px;
}

/* Actions */ 
/* -------------------------- */

/* Create Document */
.actions {
  padding: 20px;
}


/* Stacks */

#stackView, .stacks {
  height: 100%;
}


/* Subjects Panel */

.panel.subjects .available-subjects {
  padding: 20px;
}

.data-toolbox {
	background-color: #262626;
	height: 50px;
}

.toolbox {
	float: left;
}

.toolbox ul {
	list-style: none;
}

.toolbox ul li {
	float: left;
	padding: 3px 10px;
	width: 70px;
	display: block;
	text-align: center;
	cursor: pointer;
}

.toolbox ul li.active {
	color: #f8f8f8;
	border-bottom: 2px solid #f8f8f8;
}

.toolbox ul li:hover {
	color: #f8f8f8;
}

.toolbox ul li .title {
	font-size: 10px;
	clear: both;
	display: block;
}

.context-filters {
	float: left;
}

/* Context Toolbar */

.context-toolbar {
	float: right;
	margin: 20px;
}

.context-toolbar button {
	display: block;
	float: left;
	line-height: 30px;
	height: 30px;
	padding: 0 20px;
  margin-left: 10px;
	font-size: 13px;
	font-weight: 600;
	border-radius: 4px;
	color: #eee;
	-moz-box-shadow: none;
	box-shadow: none;
	background: #262626;
	border: none;
	cursor: pointer;
}

.context-toolbar button:hover {
	color: #fff;
}

/* Filters */

.form-search input {
	border-color: rgba(38, 38, 38, 0.3);
}

.form-search input:focus {
	border-color: rgba(38, 38, 38, 0.5);
}

/* Subject List */

.list { position: relative; display: block; margin: 0; padding: 0; list-style: none; font-size: 13px; line-height: 20px; }
.list ol { display: block; position: relative; margin: 0; padding: 0; list-style: none; }
.list ol ol { padding-left: 30px; }
.list li { display: block; position: relative; margin: 0; padding: 0; min-height: 20px; font-size: 13px; line-height: 20px; }
.list li span { display: block; height: 30px; margin: 5px; padding: 5px 10px; color: #333; text-decoration: none; border: 1px solid #ccc;
    background: #fafafa;
    background: -webkit-linear-gradient(top, #fafafa 0%, #eee 100%);
    background:    -moz-linear-gradient(top, #fafafa 0%, #eee 100%);
    background:         linear-gradient(top, #fafafa 0%, #eee 100%);
    -webkit-border-radius: 3px;
            border-radius: 3px;
    box-sizing: border-box; -moz-box-sizing: border-box;
    cursor: move;
}

.list button {
  float: left;
  background: none;
  border: 0px;
  margin-left: 8px;
  padding: 6px;
}

.list #dropzone {border: 1px dashed #ccc; background: #fafafa;}
.list #dropzone.active {border: 1px dashed #000;}

.subjects {
  height: 100%;
}

.subjects .context-panel {
  height: 70px;
  clear: both;
  border-bottom: 1px solid #eee;
}

.subjects .list {
  float: left;
  width: 50%;
  padding: 10px;
  height: 100%;
  border-right: 1px solid #eee;
  overflow: scroll;
  padding-bottom: 120px;
}

.subjects .sidebar {
  float: right;
  width: 50%;
  clear: both;
  padding: 10px;
}

/* Forms */

.sidebar .form-horizontal .form-group {
  margin: 0px;
}

.sidebar .details {
  width: 33.33333333%;
  float: left;
  text-align: left;
  font-size: 16px;
  font-weight: 200;
  padding-bottom: 10px;
  padding-top: 7px;
  margin-bottom: 0;
  display: inline-block;
  max-width: 100%;
}

.sidebar .field {
  width: 65%;
  float: left;
}

.sidebar textarea {
  height: 150px;
}

/**
 * Nestable
 */

.dd { position: relative; display: block; margin: 0; padding: 0; max-width: 600px; list-style: none; font-size: 13px; line-height: 20px; }

.dd-list { display: block; position: relative; margin: 0; padding: 0; list-style: none; }
.dd-list .dd-list { padding-left: 30px; }
